import { BrowserRouter} from "react-router-dom";
import { Routes, Route } from "react-router-dom";
import Home from './Pages/Home'
import './App.css';
import Info from "./Pages/Info";

function App() {
  return (
    <div>
         <BrowserRouter>
      <Routes>
      <Route path="/" element={<Home/>} />
      <Route path="/info" element={<Info/>} />
      </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
